#define WHITE 0xFFFF
#define BLACK 0x0
#define FLIPPER_LENGTH 30 //in pixels
// #define FLIPPER_L_X 129
#define FLIPPER_L_X 152
#define FLIPPER_L_Y 219
// #define FLIPPER_R_X 210
#define FLIPPER_R_X 233
#define FLIPPER_R_Y 219
#define DEFAULT_FLIPPER_ANGLE 0.5350 //in radians, equal to 30 degrees
// {x0,y0}, {x1,y1} [left(0)/right(1)][x(0)/y(1)]
#define NUM_FLIPPER_ANGLES 14
int flipper_angle_counter = 0;
double flipper_angles[NUM_FLIPPER_ANGLES] = {0.48, 0.42, 0.35, 0.28, 0.2, 0.11, 0.01, 0.01, 0.11, 0.2, 0.28, 0.35, 0.42, 0.48};
//[L/R][x/y]
int flipper_end_location[2][2] = {{0, 0},{0, 0}};
int prev_flipper_end_location[2][2] = {{0, 0},{0, 0}};

void plot_pixel(int x, int y, short int line_color)
{
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

void swap(int* p1, int* p2){
    int temp;
    temp = *p1;
    *p1 = *p2;
    *p2 = temp;
}

void draw_box(int x, int y, short int colour){
    for(int i = -2; i <= 3 ; i++){
        plot_pixel(x+3,y+i,colour);
        plot_pixel(x+2,y+i,colour);
        plot_pixel(x+1,y+i,colour);
        plot_pixel(x,y+i,colour);
        plot_pixel(x-1,y+i,colour);
        plot_pixel(x-2,y+i,colour);
    }    
}

void draw_thick_line(int x0, int y0, int x1, int y1, short int colour){
    bool is_steep = abs(y1-y0) > abs(x1-x0);
    int temp;
    if(is_steep){
        swap(&x0, &y0);
        swap(&x1, &y1);
    }
    if(x0 > x1){
        swap(&x0, &x1);
        swap(&y0, &y1);
    }

    int dx = x1 - x0;
    int dy = abs(y1 - y0);
    int error = -(dx/2);
    int y = y0;
    int y_step;
    if(y0 < y1) y_step = 1;
    else y_step = -1;

    for(int x = x0; x <= x1; x++){
        if(is_steep){
			draw_box(y,x,colour);
		}
        else {
			draw_box(x,y,colour);
		}
        error += dy;
        if(error > 0){
            y += y_step;
            error -= dx;
        }
    }
}
void animate_flipper(){
    update_flipper_end_location(flipper_angles[flipper_angle_counter-1]);
    flipper_angle_counter -= 1;
}

void update_flipper_end_location(double angle){
    //update prev
    for(int i = 0; i < 2; i++){ //left or right flipper
        //update x and y
        prev_flipper_end_location[i][0] = flipper_end_location[i][0]; 
        prev_flipper_end_location[i][1] = flipper_end_location[i][1]; 
    }
    //update current
    double xleft = FLIPPER_L_X + FLIPPER_LENGTH * cos(angle);
    double yleft = FLIPPER_L_Y + FLIPPER_LENGTH * sin(angle);
    flipper_end_location[0][0] = (int) xleft;
    flipper_end_location[0][1] = (int) yleft;


    double xright = FLIPPER_R_X - FLIPPER_LENGTH * cos(angle);
    double yright = FLIPPER_R_Y + FLIPPER_LENGTH * sin(angle);
    flipper_end_location[1][0] = (int) xright;
    flipper_end_location[1][1] = (int) yright;
}

void draw_flippers(){
    int xleft = flipper_end_location[0][0];
    int yleft = flipper_end_location[0][1];
    int xright = flipper_end_location[1][0];
    int yright = flipper_end_location[1][1];

    draw_thick_line(FLIPPER_L_X, FLIPPER_L_Y, xleft, yleft, WHITE);
    draw_thick_line(FLIPPER_R_X, FLIPPER_R_Y, xright, yright, WHITE);
}

void erase_flippers(){
    int xleft = prev_flipper_end_location[0][0];
    int yleft = prev_flipper_end_location[0][1];
    int xright = prev_flipper_end_location[1][0];
    int yright = prev_flipper_end_location[1][1];

    draw_thick_line(FLIPPER_L_X, FLIPPER_L_Y, xleft, yleft, BLACK);
    draw_thick_line(FLIPPER_R_X, FLIPPER_R_Y, xright, yright, BLACK);
}


int main(void)
{
	
	volatile int * pixel_ctrl_ptr = (int *)0xFF203020;   // pointer to the base register of controller
    pixel_buffer_start = *pixel_ctrl_ptr;
	
    for(int i = 0; i < 320; i++){
        for(int j = 0; j < 240; j++){
            plot_pixel(i, j, freeplay[j][i]);
        }
    }

	update_flipper_end_location(DEFAULT_FLIPPER_ANGLE);
    draw_flippers();

    while(1){
        erase_flippers();
        if(flipper_angle_counter == 1 ) flipper_angle_counter = NUM_FLIPPER_ANGLES;
        animate_flipper();
        draw_flippers();
    }
}